import React, { useState } from "react"
 function Navi(){
     const [email,setemail]=useState("")
     const [password,setpassword]=useState("")
   

     const handleEmail=(e)=>{
        setemail(e.target.value)
     }
     const handlePassword=(e)=>{
        setpassword(e.target.value)
     }
    const myFunction=()=>{
        if(email.length <5){
            alert("atlest more than six chatcters")
        }
        else if(password !== password){
            alert("password does not match")
        }
        else{
            alert("sucessfullu submited")
        }
      }
    return(
        <div>
            <form onSubmit={myFunction}>
            <label>email:</label>
            <input type="email" placeholder="email" required ref={handleEmail}/>
            <br/><br></br>
            <label>password:</label>
            <input type="password" placeholder="password" required ref={handlePassword}/>
            <br/><br></br>
            <button onClick={myFunction}>Login</button>
            </form>
        </div>
    )
 }
 export default Navi;
